import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import Footer from '../components/Footer';
import Header from '../components/Header';
import Context from '../context/context';
import '../styles/Profile.css';

// import { Container } from './styles';

function Profile() {
  const { loginInput } = useContext(Context);
  const profile = 'Profile';
  const bool = false;
  return (
    <div>
      <Header title={ profile } hasSearch={ bool } />
      <div>
        <h3 className="email" data-testid="profile-email">{loginInput.email}</h3>
        <div className="profile-btn">
          <Link to="/done-recipes">
            <button className="btn" type="button" data-testid="profile-done-btn">
              Done Recipes
            </button>
          </Link>
          <Link to="/favorite-recipes">
            <button className="btn" type="button" data-testid="profile-favorite-btn">
              Favorite Recipes
            </button>
          </Link>
          <button className="btn" type="button" data-testid="profile-favorite-btn">
            Logout
          </button>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Profile;
